import { Download, Film, ZoomIn, ZoomOut, RotateCcw } from "lucide-react";
import { HelpButtonWithTooltip } from "../HelpButtonWithTooltip";
import { TimelineControls } from "./TimelineControls";

export const TimelineHeader = ({
  draggedItem,
  isDragging,
  setShowExportModal,
  isTimelineDragging,
  isResizing,
  dropPreview,
  draggedTimelineItem,
  resizeItem,
  resizeHandle,
  copiedItem,
  timelineZoom,
  selectedTimelineItem,
  onOpenExportModal,
  addOverlayTrack,
  addAudioTrack,
  addToTimelineAtCurrentTime,
  splitTimelineItem,
  copyTimelineItem,
  pasteTimelineItem,
  deleteSelectedItem,
  zoomIn,
  zoomOut,
  resetZoom,
}) => {
  const getStatusMessage = () => {
    if (draggedItem) {
      const trackType =
        draggedItem.type === "video"
          ? "Main Video"
          : draggedItem.type === "audio" || draggedItem.type === "music"
          ? "Audio"
          : "Overlay";
      return `- Готов добавить: "${draggedItem.name}" на ${trackType} дорожку`;
    }

    if (isDragging && dropPreview) {
      return `- Adding "${draggedItem?.name}" ${
        dropPreview.shouldRipple ? "⚡ ripple" : "📍 exact"
      }`;
    }

    if (isTimelineDragging && dropPreview) {
      return `- Moving "${draggedTimelineItem?.name}" ${
        dropPreview.shouldRipple ? "⚡ push blocks" : "📍 exact"
      }`;
    }

    if (isResizing && resizeItem) {
      return `- Trimming "${resizeItem.name}" (${resizeHandle} edge)`;
    }

    if (copiedItem) {
      return `- "${copiedItem.name}" copied (Ctrl+V to paste)`;
    }

    return "";
  };

  const handleDownloadOpen = () => {
    setShowExportModal(true);
  };
  return (
    <div className="bg-gray-50 p-4 border-b border-gray-200 space-y-3">
      <div className="flex items-center justify-between">
        <h4 className="text-gray-800 font-semibold flex items-center space-x-2">
          <Film size={18} />
          <span>Timeline Pro</span>
 <button
  onClick={handleDownloadOpen}
  className="relative px-8 py-4 bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 hover:from-indigo-600 hover:via-purple-600 hover:to-pink-600 text-white font-bold text-xl rounded-3xl shadow-[0_10px_40px_rgba(139,69,193,0.3)] hover:shadow-[0_15px_50px_rgba(139,69,193,0.5)] transform hover:scale-105 transition-all duration-500 animate-pulse hover:animate-none group overflow-hidden"
  title="Экспорт готового видео"
>
  {/* Анимированный фон */}
  <div className="absolute inset-0 bg-gradient-to-r from-pink-500 via-red-500 to-yellow-500 opacity-0 group-hover:opacity-100 transition-opacity duration-500"></div>
  
  <div className="relative flex items-center gap-4">
    <span className="text-2xl animate-bounce">🎬</span>
    <div className="flex items-center gap-2">
      <Download size={24} className="group-hover:translate-y-1 transition-transform duration-300" />
      <span className="tracking-wide">ЭКСПОРТ ВИДЕО</span>
    </div>
    <span className="text-2xl animate-spin group-hover:animate-none">✨</span>
  </div>
  
  {/* Блестки */}
  <div className="absolute top-0 left-1/4 w-2 h-2 bg-white rounded-full opacity-80 animate-ping" style={{animationDelay: '0s'}}></div>
  <div className="absolute bottom-0 right-1/4 w-1 h-1 bg-white rounded-full opacity-60 animate-ping" style={{animationDelay: '1s'}}></div>
</button>
          <span className="text-blue-600 text-sm">{getStatusMessage()}</span>
        </h4>

        <div className="flex items-center space-x-3">
          <div className="flex items-center space-x-2 bg-white rounded-xl p-2 border border-gray-200">
            <button
              onClick={zoomOut}
              className="p-1 text-gray-600 hover:text-blue-600 transition-colors"
              title="Zoom Out (-)"
            >
              <ZoomOut size={16} />
            </button>
            <span className="text-xs text-gray-500 min-w-12 text-center">
              {(timelineZoom * 100).toFixed(0)}%
            </span>
            <button
              onClick={zoomIn}
              className="p-1 text-gray-600 hover:text-blue-600 transition-colors"
              title="Zoom In (+), or Ctrl+Wheel"
            >
              <ZoomIn size={16} />
            </button>
            <button
              onClick={resetZoom}
              className="p-1 text-gray-600 hover:text-blue-600 transition-colors"
              title="Reset Zoom (0)"
            >
              <RotateCcw size={16} />
            </button>
            <HelpButtonWithTooltip />
          </div>
        </div>
      </div>

      <TimelineControls
        draggedItem={draggedItem}
        selectedTimelineItem={selectedTimelineItem}
        copiedItem={copiedItem}
        addOverlayTrack={addOverlayTrack}
        addAudioTrack={addAudioTrack}
        addToTimelineAtCurrentTime={addToTimelineAtCurrentTime}
        splitTimelineItem={splitTimelineItem}
        copyTimelineItem={copyTimelineItem}
        pasteTimelineItem={pasteTimelineItem}
        deleteSelectedItem={deleteSelectedItem}
      />
    </div>
  );
};
